INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (5, 325, 0, 40011, 1, "クリア", 2, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 126001);
